import React, { Component } from "react";
import { OwpButton, OwpSearchDateField, OwpSearchSelectField, OwpSearchTextField, OwpTextField } from 'owp/wrapper';
import Formsy from "formsy-react";
import * as TGEvent from 'owp/TGEvent';
import moment from "moment";
import { query } from 'owp/api';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {

        };
    }
    /**
     * Owp에서 사용하는 인풋에 대해 모두 사용할 수 있는 change 이벤트 리시버
     * @param {Event} event 발생한 이벤트 객체
     * @param {Function} callback 콜백 함수. 인풋의 name, value를 인수로 전달함.
     */
    componentDidMount() {
        const _showApprovalDialog = this.showApprovalDialog;
    }

    //날짜 디폴드값 설정 함수

    render() {
        return (
            <React.Fragment>
                <div style={{ width: '100%' }}>
                    <div>
                        <table className="table table-bordered table-advance tlw5">
                            <tbody>
                                <tr>
                                    <th className="left" width="120">장비명</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.FACILITY_NAME"
                                            id="OWP_MBR.FACILITY_NAME"
                                        />
                                    </td>
                                    <th className="left" width="120">장비ID</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.FACILITY_ID"
                                            id="OWP_MBR.FACILITY_ID"
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <th className="left">MBR 번호</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.MBRNO"
                                            id="OWP_MBR.MBRNO"
                                        />
                                    </td>
                                    <th className="left">버전 번호</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.MBRVER"
                                            id="OWP_MBR.MBRVER"
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <th className="left">작성자</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.WUSERSEQ"
                                            id="OWP_MBR.WUSERSEQ"
                                        />
                                    </td>
                                    <th className="left">작성일</th>
                                    <td className="left">
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            name="OWP_MBR.WDATE"
                                            id="OWP_MBR.WDATE"
                                        />
                                    </td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Page;
